import React from 'react';
//Styles imports
import {Navbar, Nav, NavItem} from 'react-bootstrap'
import {NavLink} from 'react-router-dom'

const NaviBar = ({}) => (
  <Navbar inverse fluid fixedTop>
    <Navbar.Header>
      <Navbar.Brand>
        <img src="https://pngimage.net/wp-content/uploads/2018/06/logo-icon-png-5.png" alt=""/>
      </Navbar.Brand>
    </Navbar.Header>
    <Nav>
      <NavItem><NavLink to="/" className="nav-link" activeClassName="active">Accueil</NavLink></NavItem>
      <NavItem><NavLink to="/tasks" className="nav-link">TÃ¢ches</NavLink></NavItem>
      <NavItem><NavLink to="/contacts" className="nav-link">Annuaire</NavLink></NavItem>
      <NavItem><NavLink to="/calendar" className="nav-link">Calendrier</NavLink></NavItem>
    </Nav>
  </Navbar>

);

export default NaviBar;
